    [],nt"num_tags": 10,nt"name": "lake-andes-wetland-management-district-annual-narrative-report-calendar-year-1978",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lake Andes Wetland
    Management District outlines Refuge accomplishments during the 1978 calendar year.
    The report begins with an introduction to the Refuge and information about weather
    conditions, habitat conditions, land acquisition activities, and the system status.
    Construction, maintenance, and wildfires are also described. Habitat management
    is covered; croplands, grasslands, wetlands, forests, and easements for waterfowl
    management are discussed. The wildlife section of the report discusses endangered
    and threatened species, migratory birds, and mammals. Interpretation and recreation
    activities are outlined; topics include information and interpretation, recreation,
    and law enforcement. Field investigations, items of interest, safety information,
    and Refuge brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
